import React, { Component, Fragment, useState, useEffect } from 'react';
import { Grid } from '@material-ui/core/';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import SearchIcon from '@material-ui/icons/Search';
import InputBase from '@material-ui/core/InputBase';
import TypoGraphy from '@material-ui/core/Typography';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import chat from '../image/chat.png';
import bell from '../image/bell.png';
import logo from '../image/arkademy-logo.png';
import axios from 'axios';
import getAuth from '../helpers/auth';
import Cards from './Cards';
import '../styles/CardList.css';

import '../styles/Navbar.css';


class Navbar extends Component {
    constructor() {
      super()
      this.state = {
          data: [],
          search: ''
      }
  }


  handleSearch = (e) => {
    console.log("VALUES ", e.target.value)
    this.setState({search: e.target.value})
  }

  handleFilterSkill = (e) => {
    console.log("VALUES ", e.target.value)
    this.setState({search: e.target.value})
  }

  componentDidMount(){
      const auth = getAuth();
      console.log("Get Aouth ",auth)
      console.log("Get Aouth Role",auth.role)
      const authRole = auth.role
      if (authRole === 'company') {
          axios.get('http://localhost:5000/v1/engineer', { headers: { Authorization: `Bearer ${auth.token}`}})
          .then(res => {
              console.log("res axios ",res.data)
              this.setState({
                  data: res.data.result 
              })
          })
      } else if (authRole === 'engineer') {
          axios.get('http://localhost:5000/v1/engineer/profile', { headers: { Authorization: `Bearer ${auth.token}`}})
          .then(res => {
              console.log("res axios ke-2 ", res.data.data)
              this.setState({
                  data:res.data.data
              })
          })
          .catch(err => {
              console.log(err)
          })
      }
  }




    render() {
      let search = this.state.data.filter(
        (data) => {
          return data.name_engineer.toLowerCase().indexOf(this.state.search.toLowerCase()) !== -1;
        }
      );

      const [posts, setPosts] = useState([]);
      const [loading, setLoading] = useState(false);
      const [currentPage, setCurrentPage] = useState(1);
      const [postsPerPage, setPostsPerPafe] = useState(3);

      useEffect(() => {
        const fetchPost = async () => {
          setLoading(true);
          const res = await axios.get('http://localhost:5000/v1/engineer', { headers: { Authorization: `Bearer ${auth.token}`}});
          setPosts(res.data)
          setLoading(false)
        }

        fetchPost();
      });


      return (
        <Fragment>
          <AppBar position="fixed" color="inherit">
            <Toolbar>
              <div className="nav-group">
                <img src={logo} className="logo" alt="logo" />
                <div className="search">
                  <SearchIcon />
                  <InputBase
                    type="text"
                    placeholder="Search…"
                     value={this.state.search}
              onChange={this.handleSearch.bind()}
                    inputProps={{ 'aria-label': 'search' }}
                  />
                </div>
                <div className="home">
                  <TypoGraphy variant="inherit" gutterbottom="true">
                    <h4>Home</h4>
                  </TypoGraphy>
                  <TypoGraphy className="user-detail" variant="inherit" gutterbottom="true">
                      <Avatar>U</Avatar>
                      <h4>User</h4>
                  </TypoGraphy>
                  <TypoGraphy className="typo-wrap" variant="inherit" gutterbottom="true">
                      <hr width="1" size="40" />
                      <img src={chat} className="chat" alt="chat"></img>
                      <img src={bell} className="notif" alt="bell notif"></img>
                  </TypoGraphy>
                  <Button onClick={(e) => {localStorage.removeItem('token')}}
                  >Logout</Button>
                </div>
              </div>
            </Toolbar>
          </AppBar>

          // START
          {/* <CardList /> */}
          <Grid className="map">
            {
                search && search.map(data => {
                    return <Cards key={data.id} name={data.name_engineer}
                    desc={data.description} skill={data.skill}/>
                })
            }

            </Grid>


        </Fragment>
      )
    }
  }

export default Navbar
